import React from 'react';
import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './components/Home';

function App() {
  return (
    <>

      <Routes>
        <Route exact path="/" component={Home} />
      </Routes>
    </>
  );
}

export default App;
